import React from "react";
import Slider from "react-slick";

import "../FeedBackSlider/FeedBackSlider.scss";

export default function FeedBackSlider(props) {

    const settings = {
        dots: false,
        infinite: false,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };

    return (
        <Slider {...settings}>
            {children}
        </Slider>
    );
}
